import { useEffect, useState } from "react"


function Grades(){
    const [grades,setGrades]= useState()
    useEffect(async()=>{
        const res =await fetch("http://localhost:8000/gradesof/"+localStorage.getItem("UTIS"))
        if(res.ok){
            setGrades(res.json())
        }
    },[])
    return 

}

export default Grades
